import styled from '@emotion/styled';


export const AuthNavCss = styled.ul`
    color: white;
    display: flex;
    gap: 30px;
    margin-bottom: 20px;
    padding-right: 30px;
    margin-left: 910px;
`;

export const NavLinkStyle = styled.a`
  font-family: 'Josefin Sans', sans-serif;
  font-style: normal;
  font-weight: 600;
  font-size: 20px;
  line-height: 28px;
  color: #E4E2DD;
  text-decoration: none;
`;
